import React from 'react';
import Trump from '../../assets/two.png';

const Navbar = () => {
  return (
    <div className='navbar'>
      <img src={Trump} style={{ height: '10rem', margin: '0', padding: '0' }} />
    </div>
  );
};

export default Navbar;
